import { Grid } from 'semantic-ui-react';
import Topics from '../component/Topics';

function Posts(){
    return (
        <Grid>
            <Grid.Row>
                <Grid.Column width={3}>
                    <Topics as={Link} to="/"/>
                </Grid.Column>
                <Grid.Column width={10}>2</Grid.Column>
                <Grid.Column width={3}></Grid.Column>
            </Grid.Row>
        </Grid>
    );
}

export default Posts;
